import React from "react";

const Card4 = () => {
  return (
    <section className="section4li">
      <div>
        <CardMainTitle />
        <ul className="section4li_ul">
          <div>
            <div className="section4li_ul_list">
              <div>{cardListTag}</div>
            </div>
          </div>
        </ul>
      </div>
    </section>
  );
};

export default Card4;
